DROP TABLE IF EXISTS `sys_bug`;
CREATE TABLE `sys_bug` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `STATUS` char(1) DEFAULT NULL COMMENT '状态',
  `ATTACHMENT_URL` varchar(300) DEFAULT NULL COMMENT '附件URL',
  `BUG_NAME` varchar(300) DEFAULT NULL COMMENT 'bug名称',
  `DESCRIPTION` varchar(2000) DEFAULT NULL COMMENT '描述',
  `CREATED` datetime DEFAULT NULL COMMENT '创造日期',
  `LASTMOD` datetime DEFAULT NULL COMMENT '修改日期',
  `CREATER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `MODIFYER` varchar(32) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='bug表';

