-- ----------------------------
--  Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `ID` varchar(32) NOT NULL COMMENT '日志自动ID',
  `type` int(11) DEFAULT NULL COMMENT '日志类型 1-NFO日志 2-DEBUG日志 3-ERROR日志',
  `content` varchar(4000) DEFAULT NULL COMMENT '日志内容',
  `username` varchar(255) DEFAULT NULL COMMENT '操作人',
  `logip` varchar(255) DEFAULT NULL COMMENT '操作IP',
  `manipulatename` varchar(100) DEFAULT NULL COMMENT '操作所属模块',
  `classname` varchar(500) DEFAULT NULL COMMENT '操作类名',
  `CREATED` date DEFAULT NULL COMMENT '创造日期',
  `LASTMOD` date DEFAULT NULL COMMENT '修改日期',
  `CREATER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `MODIFYER` varchar(32) DEFAULT NULL COMMENT '修改人',
  `EXCEPTIONDETAIL` varchar(3000) DEFAULT NULL,
  `LOGPARAMS` varchar(3000) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='日志表';

