-- ----------------------------
--  Table structure for `sys_role`
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `ID` varchar(32) NOT NULL COMMENT '角色编码',
  `NAME` varchar(55) DEFAULT NULL COMMENT '角色名称',
  `TYPE` int(10) DEFAULT NULL COMMENT '角色类型0-系统1-普通',
  `ENABLED` int(10) DEFAULT NULL COMMENT '角色启用状态0-启用 1-禁用',
  `SORT` int(10) DEFAULT NULL COMMENT '排序',
  `DESCRIPTION` varchar(500) DEFAULT NULL COMMENT '角色描述',
  `CREATED` datetime DEFAULT NULL COMMENT '创造时间',
  `LASTMOD` datetime DEFAULT NULL COMMENT '修改时间',
  `CREATER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `MODIFYER` varchar(32) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统角色资料';

