-- ----------------------------
--  Table structure for `train_prcing`
-- ----------------------------
DROP TABLE IF EXISTS `train_prcing`;
CREATE TABLE `train_prcing` (
  `id` varchar(50) NOT NULL COMMENT '培训内容子表主键ID',
  `train_id` varchar(50) NOT NULL COMMENT '培训内容外键ID',
  `train_type` varchar(32) NOT NULL COMMENT '培训类型',
  `title` varchar(100) NOT NULL COMMENT '培训简介主标题',
  `subject_title` varchar(100) NOT NULL COMMENT '培训简介副标题',
  `revisions` varchar(20) NOT NULL COMMENT '定价时间',
  `content_first` int(2) DEFAULT NULL COMMENT '业务范围1，如果是0则代表未含此项，1则反之，一下4点均如此',
  `content_second` int(2) DEFAULT NULL COMMENT '业务范围2',
  `content_third` int(2) DEFAULT NULL COMMENT '业务范围3',
  `content_fourth` int(2) DEFAULT NULL COMMENT '业务范围4',
  `price` decimal(10,0) NOT NULL COMMENT '培训价格',
  `creater` varchar(50) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modifyer` varchar(64) DEFAULT NULL,
  `lastmod` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

